import React from 'react';
import { Row, Col } from 'antd';

const AppLayout = ({ children }) => {
    return (
        <>
            <Row gutter={[16, 16]}>
                <Col md={4}>

                </Col>
                
                <Col md={12}>
                {children}
                </Col>
                
                <Col md={4}>

                </Col>
            </Row>
        </>
    )
}

export default AppLayout;
